import React from "react";
import {
  BannerWrap,
  BannerLeft,
  BannerRight,
  MainText,
  ReasonTitle,
} from "../styles/MapContainer";
import MapComponent from "../components/MapComponent";

function MapContainer() {
  return (
    <BannerWrap>
      <BannerLeft>
        <ReasonTitle>Локација</ReasonTitle>
        <MainText>
        Николе Пашића 20 34220 Лапово
        </MainText>
        <MapComponent />
      </BannerLeft>
      <BannerRight></BannerRight>
    </BannerWrap>
  );
}

export default MapContainer;
